import React from "react";
import Card from "./Card"
import details from "./Details_page"





export default Favs;






const Favs = () =>{
 
    const favseries = 'netflix'
    
    if(favseries==="netflix"){
        return(
        <>
        <Card 
          card_img = {details[0].card_img}
          links = {details[0].links}
          title = {details[0].title}
          headname ={details[0].headname}
        />
        <Card  
          card_img = {details[1].card_img}
          links = {details[1].links}
          title = {details[1].title}
          headname ={details[1].headname}
        />
        <Card 
          card_img = {details[2].card_img}
          links = {details[2].links}
          title = {details[2].title}
          headname ={details[2].headname}
        />
        <Card 
          card_img = {details[3].card_img}
          links = {details[3].links}
          title = {details[3].title}
          headname ={details[3].headname}
        />
        <Card 
          card_img = {details[4].card_img}
          links = {details[4].links}
          title = {details[4].title}
          headname ={details[4].headname}
        />
       
        
        <Card 
          card_img = {details[6].card_img}
          links = {details[6].links}
          title = {details[6].title}
          headname ={details[6].headname}
        />
        <Card 
          card_img = {details[7].card_img}
          links = {details[7].links}
          title = {details[7].title}
          headname ={details[7].headname}
        />
        <Card 
          card_img = {details[8].card_img}
          links = {details[8].links}
          title = {details[8].title}
          headname ={details[8].headname}
        />
       
        <Card 
          card_img = {details[12].card_img}
          links = {details[12].links}
          title = {details[12].title}
          headname ={details[12].headname}
        />
        </>
        );
    
    }else if(favseries="hotstar"){
        return(<>
        <Card 
        card_img = {details[5].card_img}
        links = {details[5].links}
        title = {details[5].title}
        headname ={details[5].headname}
      />
        <Card 
        card_img = {details[9].card_img}
        links = {details[9].links}
        title = {details[9].title}
        headname ={details[9].headname}
      />
      <Card 
        card_img = {details[10].card_img}
        links = {details[10].links}
        title = {details[10].title}
        headname ={details[10].headname}
      />
      <Card 
        card_img = {details[11].card_img}
        links = {details[11].links}
        title = {details[11].title}
        headname ={details[11].headname}
      />
        <Card 
          card_img = {details[13].card_img}
          links = {details[13].links}
          title = {details[13].title}
          headname ={details[13].headname}
        /> 
        <Card 
          card_img = {details[16].card_img}
          links = {details[16].links}
          title = {details[16].title}
          headname ={details[16].headname}
        /> 
    
    </>)
    }
    
    else{
        return (
            <>
    
         <Card 
          card_img = {details[15].card_img}
          links = {details[15].links}
          title = {details[15].title}
          headname ={details[15].headname}
          />  
            </>
        )
    }
    
    
    }
